def getSpatialTable( nbr ):
    global profiles, paths
    if nbr >= len(profiles):
        profiles = [ profiles[i] if i<nbr else [] for i in range(nbr+1) ]
        paths = [ paths[i] if i<nbr else [] for i in range(nbr+1) ]
    if profiles[nbr] == []:
        pr,pa = buildSpatialTable( nbr )
        profiles[nbr] = pr
        paths[nbr] = pa
    return profiles[nbr].copy(), paths[nbr].copy()

